        <Link to={"/feed" + Images2016[index + 1].src}>
          <i className="fas fa-chevron-right pl-4"></i>
        </Link>
      );
    } else if (index === Images2016.length - 1) {
      leftButton = (
        <Link to={"/feed" + Images2016[index - 1].src}>
          <i className="fas fa-chevron-left pr-4"></i>
        </Link>
      );
    } else {
      leftButton = (
        <Link to={"/feed" + Images2016[index - 1].src}>
          <i className="fas fa-chevron-left pr-4"></i>
        </Link>
      );
      rightButton = (
        <Link
          to={"/feed" + Images2016[index + 1].src}
          style={{ color: "black" }}
        >
          <i className="fas fa-chevron-right pl-4"></i>
        </Link>
      );
    }
    return (
      <div>
        <div className="d-flex justify-content-end">
          <Link to={"/feed"} style={{ color: "#999999" }}>
            <i className="fas fa-times mr-5 mt-2"></i>
          </Link>
        </div>
        <div className="d-flex align-items-center justify-content-center">
          <i className="fas fa-chevron-left pr-4"></i>
          <div className="d-flex justify-content-center mt-0">
            <img
              className="img-fluid"
              src={Images2016[1].src}
              alt={Images2016[1].title}
              style={{
                maxHeight: "94vh",
                objectFit: "contain",
              }}
            ></img>
          </div>
          {rightButton}
        </div>
      </div>
    );
  }
}
